import React, { useEffect } from 'react';

import { Line } from 'react-chartjs-2';


const BarChart = () => {

    // const [people, getPeople] = useState([{}]);
    // useEffect(()=>{
    //   fetch('http://localhost:3001/data')
    //   .then(res => res.json())
    //   .then(data => {
    //     getPeople(data);
    //   })
    // },[]);
   const people = [{"count":"2","age":"18"},{"count":"4","age":"21"},{"count":"1","age":"17"}];
    console.log(people);
     
    return (
        <div>
            <h1>Line Chart</h1>
            {/* Create line chart with people variable with age on x axis and count as y axis */}
            <Line
                data={{
                    labels: people[0].map((val) => {
                        return val.age;
                    }),
                    datasets: [
                        {
                            label: 'Number of People',
                            data: people[0].map((val) => {
                                return val.count;
                            }),
                            backgroundColor: [
                                'rgba(255, 99, 132, 0.6)',
                            ],
                            borderWidth: 4
                        }
                    ]
                }}  
                height={400}
                width={600}
                options={{
                    maintainAspectRatio: false
                }}
            />

        </div>
    )
}

export default BarChart;
